import cartStyle from "./Cart.module.css";
import Modal from "../UI/Modal";
import Card from "../UI/Card";

const Cart = (props) => {
  const cartItems = (
    <ul className={cartStyle[`cart-items`]}>
      {[
        {
          id: `c1`,
          name: `sushi`,
          jlh: 2,
          harga: 20.99,
        },
      ].map((e) => (
        <li>{e.name}</li>
      ))}{" "}
    </ul>
  );

  return (
    <Card>
      <Modal>
        {cartItems}
        <div className={cartStyle.total}>
          <span>Total Amount: </span>
          <span>55.99 </span>
        </div>
        <div className={cartStyle.actions}>
          <button className={cartStyle[`button--alt`]}>Close</button>
          <button className={cartStyle.button}>Order</button>
        </div>
      </Modal>
    </Card>
  );
};

export default Cart;
